
    window.FlowData = '<div id="xut-stream-flow" style="display:none;z-index:-1">   <div id="season-flow-1">   <div id="chapter-flow-2" data-margin="9.05,7.84,5.74,7.84">       <div class="WordSection1">  <p class="xxt1"><span class="st_520a904539cc8d6b">美眷</span><span class="st_c51dd65db6bf7b6b">，</span><span class="st_520a904539cc8d6b">是怎样</span><span class="st_c51dd65db6bf7b6b">“</span><span class="st_520a904539cc8d6b">炼</span><span class="st_c51dd65db6bf7b6b">”</span><span class="st_520a904539cc8d6b">成的</span><span class="st_c51dd65db6bf7b6b">？</span></p>  <p class="a st_548d5c72f34cbb6b"   id="tac_5687e43c502bc325"><span  class="st_6e1729d6c3a8bb6b"><img   src="content/gallery/1d7949a5585942ed.jpg" alt="imgac9fa1a82fd29ce" class="st_be52d2f64edfbe0b" id="img_816d1c29c36dee0b" /></span></p>  <p class="MsoNormal st_80024f81cbef9a0b" ><span class="st_566aba68c3985a0b">盘点娱乐圈的分分合合，明星羽毛球队三对相恋十余载的夫妇——任静</span><span class="st_d3b068cf323ba80b">&amp;</span><span class="st_566aba68c3985a0b">付笛生、吕丽萍</span><span class="st_d3b068cf323ba80b">&amp;</span><span class="st_566aba68c3985a0b">孙海英、曹颖</span><span class="st_d3b068cf323ba80b">&amp;</span><span class="st_566aba68c3985a0b">王斑，现在还是好榜样！他们训练总是结伴而行，偶尔来一局对打和双打切磋技艺，也是运动第一，成绩第二，重在锻炼默契。这不是夫唱妇随或妇唱夫随，是爱相随！</span></p>  <p class="xxt1"><span class="st_520a904539cc8d6b">像范玮琪</span><span  class="st_58d8fa2564bdda0b">&amp;</span><span class="st_520a904539cc8d6b">陈建州一样</span><span class="st_c51dd65db6bf7b6b">，</span><span class="st_520a904539cc8d6b">分开运动也不错</span><span class="st_c51dd65db6bf7b6b">！</span></p>  <p class="a st_548d5c72f34cbb6b"   id="tac_dbfde7897e35fdc5"><span class="st_d3b068cf323ba80b"><img   src="content/gallery/42089ffa2d77d2ed.jpg" alt="imga8d1c1a225a29ce" class="st_e253d2eb5227f8ab" id="img_e5e8e0f5b32680ab" /></span></p>  <p class="a st_80024f81cbef9a0b" ><span class="st_566aba68c3985a0b">暂时若是还不想让爱人看到自己大汗淋漓的样子，或者觉得有些训练动作有点儿丑，其实，可以效仿范玮琪，趁陈建州外出打球的时候，跟着</span><span class="st_d3b068cf323ba80b">NTC</span><span class="st_566aba68c3985a0b">（</span><span class="st_d3b068cf323ba80b">Nike Training Club</span><span class="st_566aba68c3985a0b">）锻炼，甚至买一些简单的器械放在家中练习，说不定五个月后就能成功实现</span><span class="st_d3b068cf323ba80b">“</span><span class="st_566aba68c3985a0b">劈腿</span><span class="st_d3b068cf323ba80b">”</span><span class="st_566aba68c3985a0b">的愿望了。爱运动，也不一定玩儿同一个项目。不过，定期一起看一些热门体育赛事培养共同话题，是很必要的。</span></p>  <p class="xxt1"><span class="st_520a904539cc8d6b">孙俪</span><span  class="st_58d8fa2564bdda0b">&amp;</span><span class="st_520a904539cc8d6b">邓超的</span><span class="st_c51dd65db6bf7b6b">“</span><span class="st_520a904539cc8d6b">夫妻相</span><span class="st_c51dd65db6bf7b6b">”</span><span  class="st_46c27358622778ab"><br /> </span><span class="st_520a904539cc8d6b">有迹可循哦</span><span class="st_c51dd65db6bf7b6b">！</span></p>  <p class="a st_548d5c72f34cbb6b"   id="tac_3aa75ac44f6778d5"><span  class="st_fbdda18354df8ab"><img   src="content/gallery/1e11965445f942ed.png" alt="imgdb7caa04e48529ce" class="st_2d7ec8230c3df8ab" id="img_4482739043e178ab" /></span></p>  <p class="a st_80024f81cbef9a0b" ><span class="st_566aba68c3985a0b">孙俪曾公开表示过，自己是一个特爱运动的人，拍戏也常拿着两个哑铃在化妆间里锻炼；而邓超一开始不怎么运动，后来两人在一起后相互影响，约会有时就是专挑一天最热的时段，一起穿着长袖运动服跑步，邓先生所表现出了非凡毅力，更是深深吸引了她。所以，他们的“夫妻相”，其实有迹可循。有兴趣的爱侣们，不妨效仿一下！</span></p>  <p class="xxt1"><span class="st_520a904539cc8d6b">在燃脂甩肉的狼狈下</span><span class="st_c51dd65db6bf7b6b">，</span><span class="st_520a904539cc8d6b">遇到</span><span class="st_c51dd65db6bf7b6b">“</span><span class="st_520a904539cc8d6b">真爱</span><span class="st_c51dd65db6bf7b6b">”！</span></p>  <p class="a st_80024f81cbef9a0b" ><span class="st_566aba68c3985a0b">瑞典女王储维多利亚公主与驸马奥洛夫·丹尼尔·韦斯特林之间的故事，无疑是现代最浪漫的童话了。</span><span class="st_d3b068cf323ba80b">2000</span><span class="st_566aba68c3985a0b">年，丹尼尔在斯德哥尔摩创办</span><span class="st_d3b068cf323ba80b">Master Training</span><span class="st_566aba68c3985a0b">健身房，担任当时患有厌食症的维多利亚公主的私人形体教练，随后两人慢慢由友情发展成爱情。但由于瑞典宪法规定，王室主要成员的婚事须获政府批准，他们起初并不被看好。不过，多年来一直感情稳定，男方经营的健身事业也逐步扩展到了三家分店。</span><span class="st_d3b068cf323ba80b">2010</span><span class="st_566aba68c3985a0b">年，终于得以与小他四岁的公主正式步入婚姻殿堂，</span><span class="st_d3b068cf323ba80b">2012</span><span class="st_566aba68c3985a0b">年更育有一女。如果一个人在你燃脂甩肉的狼狈时刻爱上你，这也许就是</span><span class="st_d3b068cf323ba80b">“</span><span class="st_566aba68c3985a0b">真爱”，健身也成了约会。</span></p>  <p class="xxt1"><span class="st_520a904539cc8d6b">当杜汶泽瘦了</span><span class="st_c51dd65db6bf7b6b">，</span><span class="st_520a904539cc8d6b">田蕊妮怎么办</span><span class="st_c51dd65db6bf7b6b">？</span></p>  <p class="a st_548d5c72f34cbb6b"   id="tac_91eb223e600079a4"><span class="st_d3b068cf323ba80b"><img   src="content/gallery/8cc0b0456206aaed.png" alt="img3254e2412ca2a9ce" class="st_81dcd36ebb25f8ab" id="img_6b056ea47d7df8ab" /><img   src="content/gallery/21c371ed4a0942ed.png" alt="img599e3b9e3b3f29ce" class="st_7e2d0daa16c1d74b" id="img_ca94648b626a974b" /></span></p>  <p class="a st_89cd1dfe8686f74b" ><span class="st_566aba68c3985a0b">美国北卡罗莱纳州立大学和德克萨斯大学奥斯汀分校进行的一项研究显示，情侣中一人减肥成功后，处理不好两人关系可能会变差呢。因为，一方会更多地谈论健康行为，刺激另一半改变不健康的生活状态。问问成功塑身的杜汶泽，为新专辑做瑜伽练气的田蕊妮是不是也跟着瘦了就知道。“我花了快一年时间在健身房，每天一小时带氧运动，一周三至四次举重，但三分靠动，七分靠食。”杜</span><span class="st_d3b068cf323ba80b">sir</span><span class="st_566aba68c3985a0b">下班回家做饭，视后也不忘通过成人奶粉，从骨骼到指甲全面补充钙质。一家人分享健康，漫步人生路，是最幸福的事，记住：健康要运动饮食，</span><span class="st_d3b068cf323ba80b">1+1</span><span class="st_566aba68c3985a0b">！</span></p>  <p class="a st_7ba6242719ab974b"   id="tac_7ae4639bd6121c44"><span class="st_d3b068cf323ba80b"><img   src="content/gallery/d315e8533c7942ed.png" alt="img2425e64d79a595ce" class="st_b6f6505b6274174b" id="img_7dd2d7886214974b" /></span></p>  <p class="a st_548d5c72f34cbb6b"   id="tac_5dab87fd2c8f7844"><span class="st_aa06d3fb1cb8e40b">“</span><span class="st_483f0d25590dd74b">同病相连</span><span class="st_aa06d3fb1cb8e40b">”</span><span class="st_483f0d25590dd74b">你可要考虑清楚啊</span><span class="st_aa06d3fb1cb8e40b">！</span></p>  <p class="a st_80024f81cbef9a0b" ><span class="st_566aba68c3985a0b">有人可能还不知道，英国诺丁汉大学有研究人员指出，现代夫妻“同病相连”的比例高达</span><span class="st_d3b068cf323ba80b">70%</span><span class="st_566aba68c3985a0b">以上。要和</span><span class="st_d3b068cf323ba80b">“</span><span class="st_566aba68c3985a0b">三高</span><span class="st_d3b068cf323ba80b">”</span><span class="st_566aba68c3985a0b">（）——+{}（【{}{}【、、说拜拜，在饮食作息习惯基本相同的情况下，坚持做一项双人运动才是硬道理！不能一起去健身房，到楼下跑跑步，或在小区里打打羽毛球，都是好的！</span></p>  </div>     </div>   </div> </div> ';


